        content={notes.content}
        />
    );
}

function App(){
    return (
        <div>
        <Header />
        {/* {notes.map(createCard)}
         */}
         <Note 
        // key={notes.id}
        title={notes.title}
        content={notes.content}
        />
        <Footer />
        </div>
        )
}
export default App;
